import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Emulate a mobile device viewport
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot in mobile view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile.png'));

    // Find and click the "All" menu button to open the mobile menu
    // Using a specific selector to target the navigation menu trigger
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to appear
    const menuOverlay = page.locator('#mobileMenuOverlay');
    await menuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Verify the menu is visible and extract data
    const isMenuOpen = await menuOverlay.isVisible();

    // Click on a navigation link within the mobile menu
    const booksLink = page.locator('.mobile-menu a', { hasText: 'Books' }).first();
    await booksLink.click();

    // Click the close button to hide the mobile menu
    const closeButton = page.locator('.mobile-menu .close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Wait for the mobile menu to be hidden
    await menuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    // Take a final screenshot after closing the menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_closed.png'));

    const isMenuClosed = await menuOverlay.isHidden();

    return {
      success: true,
      action: "Successfully opened, interacted with, and closed the mobile navigation menu.",
      extractedData: {
        menuWasOpened: isMenuOpen,
        menuWasClosed: isMenuClosed
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, capture a final screenshot if possible
    try {
      const errorPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorPath });
      screenshots.push(errorPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
